{
    var data=null;
    switch(symbol)
    {
        case "000001.sh":
            data=SH_000001_M1_KLINE;
            break;
        case "000300.sh":
            data=SH_000300_M1_KLINE;
            break;
        case "399001.sz":
            data=SZ_399001_M1_KLINE;
            break;
        case "000001.sz":
            data=SZ_000001_M1_KLINE;
            break;
        case "600000.sh":
            data=SH_600000_M1_KLINE;
            break;
        case "000151.sz":
            data=SZ_000151_M1_KLINE;
            break;
        case "399005.sz":
            data=SZ_399005_M1_KLINE;
            break;
        case "399006.sz":
            data=SZ_399006_M1_KLINE;
            break;
        default:
            data=SZ_000001_M1_KLINE;
            break;
    }
    
    if (!data) return null;

    return data.data;
}

